  {
    employeeNum: "2020456",
    firstName: "Name 2",
    lastName: "Last Name 2",
    profilePic:
      "https://robohash.org/2.png",
  },
  {
    employeeNum: "2020789",
    firstName: "Name 3",
    lastName: "Last Name 3",
    profilePic:
      "https://robohash.org/3.png",
